import React, { Component } from 'react';
import Movies from './movies';
// import Counter from './counterComponet';
import Pagination from './pagination';


class Counters extends Component {
    
    render() { 

        return (   
            <React.Fragment>
                {/* <Counter prop = {this.props} /> */}
                <Movies prop = {this.props} />
                <Pagination itemsCount={this.props.paging.itemsCount} pageSize={this.props.paging.pageSize} currentPage={this.props.paging.currentPage} onPageChange={this.props.onPageChange} />
            </React.Fragment>
         );
    }

    
}
 
export default Counters;
